import React from 'react';

function Brokerage() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col-7'>
                    <h5><a href="/NotFound">Brokerage Calculator</a></h5>
                </div>
                <div className='col-5'></div>
            </div>
        </div>
     );
}

export default Brokerage;
